  return (
    <div>
      {carts.length > 0 ? (
        carts.map(cart => (
          <div key={cart._id}>
            <div>
              <img src="" alt="" />
            </div>
            <div className="product-info">
              <div className="product-name">
                Lorem ipsum dolor sit amet consectetur adipisicing eli
              </div>
              <div>
                <span className="product-qty">1 x</span>
                <span className="product-price">P20</span>
              </div>
            </div>
          </div>
        ))
      ) : (
        <div> Your cart is empty :(</div>
      )}
    </div>
  );
};

export default CartList;
